const Card = (props) => {
  return (
    <>
      <div className="box btn_shadow">
        {/*<img src={props.image} alt='' />*/}
        <i class={props.link}></i>
        <h2>{props.title}</h2>
        <p>{props.desc}</p>
        <a href="/">
          <i className="fas fa-arrow-right"></i>
        </a>
      </div>
    </>
  );
};

export default Card;
